import { useState } from "react";
import { ExcelFile, ExcelSheet } from "react-export-excel";

import "./App.css";

function App() {
  const [data, setData] = useState({});
  const [phone, setPhone] = useState();

  const multiDataSet = [
    {
      columns: [
        { value: "Telephone", widthPx: 100 }, // width in pixels
      ],
      data: [data?.result ?? []],
    },
  ];

  const handleChange = (event) => {
    setPhone(event.target.value);
  };

  const onSubmit = (e) => {
    e.preventDefault();
    fetch(`http://localhost:80/randomphonenumbers/?phone=${phone}`)
      .then((res) => res.json())
      .then((record) => setData(record));
  };

  const renderTableData = () => {
    return data?.result?.map((phone, index) => {
      return (
        <tr key={index}>
          <td>{phone}</td>
        </tr>
      );
    });
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Filtro para buscar telefonos</h1>
        <form onSubmit={onSubmit}>
          <label>Telefono: </label>
          <input type="number" onChange={handleChange} />
          <input type="submit" />
        </form>

        <table id="phones">
          <thead>
            <tr>
              <th>Phone Number</th>
            </tr>
          </thead>

          <tbody>{renderTableData()}</tbody>
        </table>
      </header>
    </div>
  );
}

export default App;
